import React from 'react';
import { View, StyleSheet } from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome';

const Footer = () => {
  return (
    <View style={styles.footerContainer}>
      <Icon name="home" size={40} color="black" />
      <Icon name="heart" size={40} color="red" />
      <Icon name="user" size={40} color="blue" />
      {/* Thêm các icon khác nếu cần */}
    </View>
  );
};

const styles = StyleSheet.create({
  footerContainer: {
    flexDirection: 'row', // Hiển thị các icon cùng một hàng
    justifyContent: 'space-around', // Các icon được căn đều trên hàng
    padding: 20,
    backgroundColor: 'lightgray', // Màu nền của footer
    marginHorizontal: 10, // Khoảng cách giữa các icon
  },
});

export default Footer;
